(function($) {
    $.fn.jSboxVideoPlayer = function(opt) {
		opt = jQuery.extend({
			widthVideo: 720,
			heightVideo: 405,
			autohidePanel: false,
			autoPlay: false,
			innerShadow: false,
			socialButton: false
				}, opt);
				
videoOpenPopup = function(soc) {
	var link="";
	var url = location.href.replace(/\#video([0-9]+)$/,"video=$1"); url = url.replace(/\?jSbox/,"");
	if (soc == "fb"){link = 'https://www.facebook.com/login.php?next=http://www.facebook.com/sharer/sharer.php?u='+url+'?social=fb';}
	else if (soc == "vk"){link = 'http://vk.com/share.php?url='+url+'?social=vk';}
	else if (soc == "mail"){link = 'http://connect.mail.ru/share?share_url='+url+'?social=mail';}
	else if (soc == "dk"){link = 'http://www.odnoklassniki.ru/dk/?st.cmd=addShare&st._surl='+url+'?social=dk';}
	else if (soc == "tw"){link = 'https://twitter.com/intent/tweet?original_referer='+url+'&text='+encodeURIComponent(document.title)+'&url='+url+'?social=tw';}
	window.open(link,"displayWindow","width=520,height=300,left=350,top=170,status=no,toolbar=no,menubar=no");
}	

var num=0;
$(".jSboxVideo").each(function(){
	$(this).attr("data-id", num);
	num++;
});

var id = window.location.hash.match(/^#video([0-9]+)$/);
if (id && id[1]) {
	$(".jSboxVideo").each(function(){
		var el = $(this);
		var num = $(this).attr("data-id");
		if (num == id[1]){
			jSboxVideoShow($(el));
		}
	});
}
				
	$(".jSboxVideo").live('click', function(){
		window.location.hash = '#video' + $(this).attr("data-id");
		jSboxVideoShow($(this));
		return false;
	});	
		
	function jSboxVideoShow(elem){
		var html ='<div id="jSboxVideo-container">';
		html +='<div id="jSboxVideo-overlay"></div>';
		html +='<a id="jSboxVideo-close" href="#"></a>';
		html +='<div id="jp_container_1" class="jp-video">';
		html +='<div class="jp-type-single">';
		html +='<div class="jp-shadow"></div>';
		html +='<div id="jquery_jplayer_1" class="jp-jplayer"><a href="javascript:;" class="jp-pause" tabindex="1">&#61516;</a></div>';
		html +='<div class="jp-gui">';
		html +='<div class="jp-video-play">';
		html +='<a href="javascript:;" class="jp-video-play-icon" tabindex="1"></a>';
		html +='</div>';
		html +='<div class="jp-interface">';
		html +='<div class="jp-controls-holder">';
		html +='<ul class="jp-controls">';
		html +='<li><a href="javascript:;" class="jp-play" tabindex="1">&#61515;</a></li>';
		html +='<li><a href="javascript:;" class="jp-pause" tabindex="1">&#61516;</a></li>';
		html +='<li><a href="javascript:;" class="jp-mute" tabindex="1" title="mute">&#61480;</a></li>';
		html +='<li><a href="javascript:;" class="jp-unmute" tabindex="1" title="unmute">&#61478;</a></li>';
		html +='</ul>';
		html +='<div class="jp-volume-bar">';
		html +='<div class="jp-volume-bar-value"></div>';
		html +='</div>';
		html +='<ul class="jp-toggles">';
		html +='<li><a href="javascript:;" class="jp-full-screen" tabindex="1" title="full screen">&#61541;</a></li>';
		html +='<li><a href="javascript:;" class="jp-restore-screen" tabindex="1" title="restore screen">&#61542;</a></li>';
		html +='</div>';
		html +='<div class="jp-progress">';
		html +='<div class="jp-seek-bar">';
		html +='<div class="jp-play-bar"></div>';
		html +='</div>';
		html +='</div>';
		html +='<div class="jp-current-time"></div>';
		html +='</div>';
		html +='</div>';
		html +='<div class="jp-no-solution">';
		html +='<span>Update Required</span>';
		html +='To play the media you will need to either update your browser to a recent version or update your <a href="http://get.adobe.com/flashplayer/" target="_blank">Flash plugin</a>.';
		html +='</div>';
		html +='</div>';
		html +='</div>';
		html +='</div>';
		
		$("body").prepend(html);
		
		var social="";
		if (opt.socialButton){
			social +='<span id="jSbox-button-social">';
			social +='<a class="soc-fb" title="Поделиться в Facebook" href="javascript:void(0)" onClick=\'videoOpenPopup("fb")\'></a>';
			social +='<a class="soc-vk" title="Поделиться ВКонтакте" href="javascript:void(0)" onClick=\'videoOpenPopup("vk")\'></a>';
			social +='<a class="soc-mail" title="Поделиться в Моем Мире" href="javascript:void(0)" onClick=\'videoOpenPopup("mail")\'></a>';
			social +='<a class="soc-dk" title="Поделиться в Одноклассниках" href="javascript:void(0)" onClick=\'videoOpenPopup("dk")\'></a>';
			social +='<a class="soc-tw" title="Поделиться в Twitter" href="javascript:void(0)" onClick=\'videoOpenPopup("tw")\'></a>';			
			social +='</span>';
			$("#jSboxVideo-container").append(social);
		}
		
		var file = $(elem).attr("href");
		var file_ogv = null;
		if ($(elem).attr("data-video-ogv")){file_ogv = $(elem).attr("data-video-ogv");}
		var file_web = null;
		if ($(elem).attr("data-video-web")){file_web = $(elem).attr("data-video-web");}
		var poster = $(elem).attr("data-poster");		
		if (parseInt($(elem).attr("data-width")) > 80){opt.widthVideo = $(elem).attr("data-width");}
		if (parseInt($(elem).attr("data-height")) > 80){opt.heightVideo = $(elem).attr("data-height");}

		$("#jquery_jplayer_1").jPlayer({
			ready: function(){
				$(this).jPlayer("setMedia", {
				m4v: file,
				ogv: file_ogv,
				webmv: file_web,
				poster: poster
				});
				if (opt.autoPlay){
					$(this).jPlayer('play');
				}
				//$(this).jPlayer("focus");
			},
			keyEnabled: true,
			swfPath: "/js/jSboxVideoPlayer",
			supplied: "ogv,webmv,m4v",
			size: {
				width: opt.widthVideo+"px",
				height: opt.heightVideo+"px"
			},
			autohide: {
				restored: opt.autohidePanel,
				fadeIn: 200,
				fadeOut: 500				
			}		
		});	
				
		var borderVideo = 23;
		widthDelta = parseInt(opt.widthVideo)+(borderVideo*2);
		heightDelta = parseInt(opt.heightVideo)+borderVideo;
		$("#jSboxVideo-container .jp-video").css({"margin-top": "-"+((heightDelta/2)+(borderVideo-1))+"px", "margin-left": "-"+(widthDelta/2)+"px"});
		$("#jSboxVideo-container .jp-jplayer").css("padding", borderVideo+"px "+(borderVideo-2)+"px 0px "+(borderVideo)+"px");
		if (opt.innerShadow){
			$("#jSboxVideo-container .jp-shadow").css({"width": (opt.widthVideo-2)+"px", "height": (opt.heightVideo-2)+"px", "top": borderVideo+"px", "left": borderVideo+"px"});
		}
		$("#jSboxVideo-container .jp-jplayer img").css({"width": (opt.widthVideo-3)+"px", "height": (opt.heightVideo-3)+"px"});
		$("#jSboxVideo-container .jp-video-play").css({"width": (opt.widthVideo-2)+"px", "height": (opt.heightVideo-2)+"px", "top": borderVideo+"px", "left": borderVideo+"px"});
		
		if (opt.socialButton){
			var winHeight = $("#jSboxVideo-container").height();
			var height = $("#jSboxVideo-container .jp-video").height();
			var left = $("#jSboxVideo-container .jp-video").offset().left;
			$("#jSboxVideo-container #jSbox-button-social").css({"top": (((winHeight-height)/2)+17)+"px", "left": left+"px"});
		}

		$("#jSboxVideo-container").css("opacity", "1");
		
		if (opt.socialButton){
			$("#jSboxVideo-container #jSbox-button-social").animate({"margin-left": "-40px", "opacity": "1"});
		}
	}
	
	$("#jSboxVideo-close").live('click', function(){
		$("#jquery_jplayer_1").jPlayer("destroy");
		$("#jSboxVideo-container").remove();
		window.location.hash = '#closejSBox';
		return false;
	});
}
})(jQuery);

